import back from "@/components/Botton/back.vue";
import { apiGetClubDetail } from "@/api/Club";
import model from "@/components/model";
export default {
  name: "myAuthority",
  components: {
    back: back,
    model: model
  },
  data: function data() {
    return {
      myData: {},
      clubId: "",
      myAuthorityList: [{
        imgurl: require("@/assets/club/list_1.png"),
        topic: this.$t('MemberManagement'),
        // 成员管理
        url: "memberManagement"
      }, {
        imgurl: require("@/assets/club/list_2.png"),
        topic: this.$t('Advertising'),
        //广告投放
        url: "ClubAdPutIn"
      }, {
        imgurl: require("@/assets/club/list_3.png"),
        topic: this.$t('TeamBonus'),
        //团队红利
        url: "CreateTeamBonus"
      }, {
        imgurl: require("@/assets/club/withdrawal.png"),
        topic: this.$t('BonusWithdrawal'),
        //红利提現
        url: "ClubDividendWithdrawal"
      }, // {
      //   imgurl: require("@/assets/club/list_4.png"),
      //   topic: this.$t('BonuDescription'), // 红利说明
      //   url: "BonuDescription"
      // },
      {
        imgurl: require("@/assets/club/edit_icon.png"),
        topic: this.$t('ClubNotice'),
        // 俱樂部公告
        url: "Notice"
      }],
      myAuthorityList2: [{
        imgurl: require("@/assets/club/list_5.png"),
        topic: this.$t('ClubPromotion'),
        //俱乐部推广
        url: ""
      }],
      isOpen: false,
      callBackMsg: "",
      isOpenBonus: false
    };
  },
  created: function created() {
    this.clubId = localStorage.getItem("ClubId");
    this.getDetail();
  },
  methods: {
    withdraw: function withdraw() {
      this.$message({
        message: this.$t('NotYetOpen'),
        //【 暂未开放 】
        type: "warning",
        center: true,
        duration: 1200
      });
    },
    // 獲取俱樂部詳細資料
    getDetail: function getDetail() {
      var _this = this;

      apiGetClubDetail("", true).then(function (res) {
        if (Math.abs(res.Code) >= 600) {
          _this.isOpen = true;
          _this.callBackMsg = res.Message;
          return;
        }

        _this.myData = res.Data;
      });
    },
    // 彈窗確定按鈕事件
    confirmBtnEvent: function confirmBtnEvent() {
      this.$router.push("/CreateClub");
    },
    myAuthorityListAction: function myAuthorityListAction(url) {
      url != "" ? this.$router.push("/".concat(url)) : this.withdraw();
    }
  }
};
